import React, { useState, useEffect } from 'react';
import './App.css';
import shipLogo from './ship.png';  // Import the ship logo image
import axios from 'axios';  // Import axios for making API calls

function App() {
  const [cargoData, setCargoData] = useState([]);
  const [unloadingAreas, setUnloadingAreas] = useState([]);
  const [urgentCargo, setUrgentCargo] = useState([]);

  // Function to fetch cargo data from the backend
  const fetchCargoData = async () => {
    try {
      const response = await axios.get('http://localhost:8080/shipments/not-arrived/eta');
      setCargoData(response.data);  // Set the cargo data from the backend
    } catch (error) {
      console.error('Error fetching cargo data', error);
    }
  };

  // Function to fetch unloading area data from the backend
  const fetchUnloadingAreas = async () => {
    try {
      const response = await axios.get('http://localhost:8080/unloading-areas');
      setUnloadingAreas(response.data);  // Set the unloading area data from the backend
    } catch (error) {
      console.error('Error fetching unloading area data', error);
    }
  };

  // Priority score calculation
  function calculatePriorityScore(cargo) {
    let score = 0;
    const etaDiff = new Date(cargo.eta) - new Date(); // time until arrival
    score += (1 / etaDiff) * 1000; // Earlier arrival = higher score
    if (cargo.cargoType === 'PERISHABLE') score += 50; // Perishable goods = higher score
    score += (10 / cargo.unloadingTime) * 20; // Lower unloading time = higher score
    if (cargo.emergency) score += 100; // Emergency = maximum score
    return score;
  }

  // Fetch data and calculate priority scores when the component is mounted
  useEffect(() => {
    fetchCargoData();  // Fetch cargo data from the backend
    fetchUnloadingAreas();  // Fetch unloading areas from the backend

    const updatePriority = () => {
      const sortedCargo = [...cargoData].sort((a, b) => calculatePriorityScore(b) - calculatePriorityScore(a));
      setUrgentCargo(sortedCargo);
    };

    updatePriority();
    const interval = setInterval(updatePriority, 600000); // Every 10 minutes
    return () => clearInterval(interval); // Cleanup interval
  }, [cargoData]);  // Re-run the effect if cargoData changes

  return (
    <div className="dashboard">
      {/* Left Panel: All Incoming Cargos */}
      <div className="all-cargos">
        <h2>All Incoming Cargos</h2>
        <table>
          <thead>
            <tr>
              <th>ID</th>
              <th>ETA</th>
              <th>Type</th>
              <th>Unloading Time</th>
              <th>Emergency</th>
            </tr>
          </thead>
          <tbody>
            {cargoData.map((cargo) => (
              <tr key={cargo.id}>
                <td>{cargo.shipmentId}</td>
                <td>{cargo.eta}</td>
                <td>{cargo.cargoType}</td>
                <td>{cargo.estimatedUnloadingTime} hours</td>
                <td>{cargo.emergency ? 'Yes' : 'No'}</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>

      {/* Right Panel */}
      <div className="right-panel">
        {/* Right Top Section: Incoming Cargo */}
        <div className="incoming-cargo">
          <h2>Incoming Cargo</h2>
          {urgentCargo.length > 0 && (
            <div className="cargo-info">
              <img src={shipLogo} alt="Ship Logo" className="ship-logo" />
              <div>
                <p><strong>ID:</strong> {urgentCargo[0].shipmentId}</p>
                <p><strong>ETA:</strong> {urgentCargo[0].eta}</p>
              </div>
            </div>
          )}
        </div>

        {/* Right Bottom Section: Unloading Areas */}
        <div className="unloading-areas">
          <h2>Unloading Areas</h2>
          <div className="areas-row">
            {unloadingAreas.map((area) => (
              <div key={area.areaID} className={`area ${area.isFilled ? 'busy' : 'free'}`}>
                <p>{area.areaID}</p>
                {area.isFilled && (
                  <>
                    <img src={shipLogo} alt="Ship" className="ship-logo" />
                    <p><strong>Cargo ID:</strong> {area.shipment.shipmentId}</p>
                    <p><strong>Start:</strong> {area.startTime}</p>
                    <p><strong>End:</strong> {area.estimatedUnloadingEnd}</p>
                  </>
                )}
              </div>
            ))}
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
